// CSS
import "../assets/css/BarraImportantes.css"

// COMPONENTS
import Icono from "../components/Icono";

function BarraImportantes() {
	return (
		<section id="barraimportantes">
			<p>Favoritos</p>
			<ul>
				<li>
					<Icono nombre="favorite" />
					Favoritos
				</li>
			</ul>
		</section>
	)
}
export default BarraImportantes;
